import '../css/Report.css';
import UserNavbar from './UserNavbar';
import Toast from 'react-bootstrap/Toast';
import api from '../servico/App';
import Profile from './Profiles';
import { useEffect, useState } from 'react';
import { format } from 'date-fns'; // Biblioteca para formatação de data

function TableReport() {
    const storageId = Profile.getStorageId();
    const [search, setSearch] = useState(""); 
    const [movimentacoes, setMovimentacoes] = useState([]);
    const [loading, setLoading] = useState(true);

    useEffect(() => {
        const fetchMovimentacoes = async () => {
            if (storageId === 0) {
                setLoading(false);
                return;
            }
            try {
                const response = await api.get(`/api/movimentacao?id_estoque=${storageId}`);
                setMovimentacoes(response.data);
            } catch (err) {
                console.error("Erro ao buscar movimentações: ", err);
            } finally {
                setLoading(false);
            }
        };
        fetchMovimentacoes();
    }, [storageId]);

    const movimentacoesFiltradas = movimentacoes
        .filter((movimentacao) =>
            movimentacao.nome?.toLowerCase().includes(search.toLowerCase())
        );

    return (
        <div>
            <UserNavbar />
            {storageId === 0 && <p>Sem estoque associado ao usuário.</p>}
            {loading && <p>Carregando dados...</p>}
            {!loading && storageId !== 0 && (
                <>
                    <Toast>
                        <Toast.Header>
                            <strong className="me-auto">Data inicial</strong>
                            <small>{format(new Date(), "dd/MM/yyyy")}</small>
                        </Toast.Header>
                        <Toast.Header>
                            <strong className="me-auto">Data final</strong>
                            <small>{format(new Date(), "dd/MM/yyyy")}</small>
                        </Toast.Header>
                    </Toast>
                    <h1>Relatório de Movimentações</h1>
                    <div className="container">
                        <table className="table">
                            <thead>
                                <tr>
                                    <th>Movimentações</th>
                                    <th>Data</th>
                                    <th>Quantidade</th>
                                    <th>Produto</th>
                                </tr>
                            </thead>
                            <tbody>
                                {movimentacoesFiltradas.map((movimentacao) => (
                                    <tr key={movimentacao.id}>
                                        <td>{movimentacao.id}</td>
                                        <td>{format(new Date(movimentacao.data), "dd/MM/yyyy")}</td>
                                        <td>{movimentacao.quantidade}</td>
                                        <td>{movimentacao.nome || movimentacao.id_prod}</td>
                                    </tr>
                                ))}
                            </tbody>
                        </table>
                        <Toast>
                            <Toast.Header>
                                <strong className="me-auto">Entrada R$</strong>
                                <small>{/* Valor calculado dinamicamente */}</small>
                            </Toast.Header>
                            <Toast.Header>
                                <strong className="me-auto">Despesas R$</strong>
                                <small>{/* Valor calculado dinamicamente */}</small>
                            </Toast.Header>
                            <Toast.Header>
                                <strong className="me-auto">Balanço final R$</strong>
                                <small>{/* Valor calculado dinamicamente */}</small>
                            </Toast.Header>
                        </Toast>
                    </div>
                </>
            )}
        </div>
    );
}

export default TableReport;
